import React from "react";
import Link from "next/link";

const Header = (props) => (
  <header>
    <h1>This is my app header</h1>
    <nav>
      <Link
        className={`nav-link${props.path === "/" ? " active" : ""}`}
        href="/"
      >
        Home
      </Link>
      <Link
        // className={`nav-link${props.path === "/other" ? " active" : ""}`}
        href="/other"
      >
        Other Page
      </Link>
    </nav>
  </header>
);

export default Header;
